function Footer() {
  return (
      <footer class="p-2 d-flex justify-content-between align-items-center">
          <div class="d-flex">
              <p class="m-0 me-2">2023. Projeto Trouver</p><button class="border-0 bg-transparent m-0 p-0" onclick="modal.show()"></button>
          </div>
          <a href=""></a>
      </footer>
  )
}

export default Footer
